import React from 'react'

const list = [
    {
      id: 'a',
      firstname: 'Robin',
      picture: 1988,
    },
    {
      id: 'b',
      firstname: 'Dave',
      lastname: 'Davidds',
      year: 1990,
    },
  ];

const Adoption = () => {
    return(
        <div className="container">
            <h4 className="left">Adoption</h4>
            <br></br>
            <ul>
                {list.map(item => (
                <li key={item.id}>
                    <div>{item.id}</div>
                    <div>{item.firstname}</div>
                    <div>{item.lastname}</div>
                    <div>{item.year}</div>
                </li>
                ))}
            </ul>
        </div>
    )
}

export default Adoption;
